function noop() {}

function fireworks(wrapperID, imgLoc, settings) {

    var env;

    // create p5 instance
    new p5((p) => {

        p.noLoop(); // deactivated by default

        const GRAVITY = p.createVector(0, 0.3);
        const SPARK_GRAVITY = p.createVector(0, 0.02);

        class FireworksEnv {
            constructor(wrapperID, imgLoc, settings = {}) {
                this.wrapperID = wrapperID;
                this.imgLoc = imgLoc;
                this.rocketImages = [];
                this.frameRate = settings.frameRate || 60;
                this.backgroundColor = settings.backgroundColor || 'rgba(0%,0%,0%, 0)'; // 0 <= backgroundColor < 256
                this.canvas = null;

                this.rockets = [];

                this.frequency = settings.frequency || 0.1; // chance for a new rocket to be born in this frame
                this.maxRockets = settings.maxRockets || 20; // only valid for random but not for manual (letter) rockets
                this.ftl = settings.ftl || 150; // frames to live
                this.sparkSize = settings.sparkSize || 8; // size of sparks
                this.minSparkAmount = settings.minSparkAmount || 20; // min amount of sparks per rocket
                this.maxSparkAmount = settings.maxSparkAmount || 100; // max amount of sparks per rocket
                this.sparkVel = settings.sparkVel || 1.0;
                this.flickerIntensity = settings.flickerIntensity || 0.8;
                this.flickererAmount = settings.flickererAmount || 1; // 1 -> every rocket is a flickerer
                this.letterSparkRandomness = settings.letterSparkRandomness || 0.05;
                this.sparkColorFadeout = settings.sparkColorFadeout || 0.06;
                this.pointOfExplosion = settings.pointOfExplosion || 2;
                this.font = settings.font || 'max-sans'; // can be 'max-sans', 'â™¥' is supported
                this.wordDuration = settings.wordDuration || 1; // time between words
                this.meanLetterTimeout = settings.meanLetterTimeout || 0; // min time between letters in seconds
                this.letterDisplayVariation = settings.letterDisplayVariation || 0;
                this.letterRandomness = settings.letterRandomness || 0; // random factor in the y position of letters
                this.shapeChance = settings.shapeChance || 0.5; // chance for shape in mixed shape modes
                this.clockIntervall = null;

                /* 
                    mode can be:
                        - 'manual'
                        - 'auto'
                        - 'random'
                        - 'hearts'
                        - 'smileys'
                        - 'cash
                        - 'mixed *' -> * can be any shape like 'hearts', 'smileys' or 'cash'
                        - default is 'auto'
                */

                this.mode = settings.mode || 'auto';

            }

            // activate rendering loop
            activate() {
                p.loop();
            }

            // deactivate rendering loop
            deactivate() {
                p.noLoop();
            }

            // connect canvas
            setCanvas(canvas) {
                this.canvas = canvas;
            }

            // handle resize events (resize canvas to max size)
            resizeCanvas() {
                p.resizeCanvas(document.getElementById(this.wrapperID).clientWidth, document.getElementById(this.wrapperID).clientHeight);
            }

            launchRocket(pos, acc, payload = null) {
                let rocket = new Rocket(pos, acc, payload);
                this.rockets.push(rocket);
            }

            launchRandomRocket(payLoad = null) { // will be displayed at a random positions
                let randomPos = p.createVector(p.random(this.canvas.width), this.canvas.height + 100);
                let randomAcc = p.createVector(p.random(2) - 1, -((Math.sqrt((p.random(this.canvas.height * 2)) + 100)) * GRAVITY.y * 2));
                this.launchRocket(randomPos, randomAcc, payLoad);
            }

            // accepts a string or an array of strings
            launchMessage(message, cb = noop) {
                if (env.canvas) {
                    if (typeof message == "string") {
                        if (message.includes(" ")) {

                            // split message string into array of words
                            message = message.split(/\s+/);
                        } else {

                            // one word to print
                            let wordDisplayTime = this.meanLetterTimeout * message.length;
                            let letterDisplayTime = 0;

                            setTimeout(() => {
                                cb();
                            }, wordDisplayTime * 1000);

                            for (let i = 0; i < message.length; i++) {

                                // calculate timeout for next letter
                                let variation = -this.letterDisplayVariation / 2 + p.random(this.letterDisplayVariation);

                                let addedTime = (message.length - i > 1) ? this.meanLetterTimeout + variation : wordDisplayTime - letterDisplayTime;
                                letterDisplayTime += addedTime;

                                // print word
                                setTimeout(() => {

                                    // get letter
                                    let letter = message[i].toUpperCase();

                                    // calc random y-offset for this rocket
                                    let yOffset = ((this.canvas.height * this.letterRandomness / 100) / 2 + p.random(this.canvas.height * this.letterRandomness / 100));

                                    // calc accelearation for this rocket
                                    let xAcc = ((-message.length / 2 + i + 0.5) / message.length / 2) * (env.canvas.width / Math.sqrt(canvas.height * 2));
                                    let yAcc = -((Math.sqrt((this.canvas.height) + 100) + yOffset) * GRAVITY.y * 2); 
                                    let acc = p.createVector(xAcc, yAcc);

                                    // shoot from middle position 
                                    let pos = p.createVector(this.canvas.width / 2, this.canvas.height + 50)

                                    if (fonts[env.font][letter]) {
                                        this.launchRocket(pos, acc, fonts[env.font][letter]);
                                    }
                                }, letterDisplayTime * 1000);
                            }
                        }
                    }

                    if (Array.isArray(message)) {
                        if (message[0] && message[0].length > 0) {

                            // print next word, once the current word calls back
                            this.launchMessage(message[0], () => {

                                setTimeout(() => {
                                    message.shift();
                                    this.launchMessage(message);
                                }, 1000 * this.wordDuration);
                            });
                        }
                    }
                } else {
                    // canvas was not attached to dom -> retry
                    setTimeout(() => {
                        this.launchMessage(message);
                    }, 50);
                }
            }

            clock(active){
                if(active){
                    this.clockIntervall = setInterval(()=>{
                        let today = new Date();
                        let hourZero = (today.getHours() < 10) ? '0' : '';
                        let minuteZero = (today.getMinutes() < 10) ? '0' : '';
                        let secondZero = (today.getSeconds() < 10) ? '0' : '';

                        var time = hourZero + today.getHours() + ":" + minuteZero + today.getMinutes() + ":" + secondZero + today.getSeconds();
                        this.launchMessage(time);

                    }, 1000);
                } else {
                    clearIntervall(this.clockIntervall);
                    this.clockIntervall = null;
                }
            }
        }

        // create environment
        env = new FireworksEnv(wrapperID, imgLoc, settings);

        class Spark {
            constructor(pos, vel) {
                this.pos = pos;
                this.vel = vel;
                this.size = p.random(Math.sqrt(env.sparkSize));
            }

            update() {
                this.vel.add(SPARK_GRAVITY);
                this.pos.add(this.vel);
            }

            draw() {
                p.strokeWeight(this.size);
                p.point(this.pos.x, this.pos.y);
            }
        }

        class Rocket {
            constructor(pos, acc, sparkVectors = null, color = null) {
                this.pos = pos;
                this.vel = acc || p.createVector(0, 0);
                this.exploded = false;
                this.flickerer = (p.random() > env.flickererAmount) ? false : true;
                this.sparks = [];
                this.sparkVectors = sparkVectors;
                this.ftl = env.ftl; // frames to live (after explosion)
                this.color = color || p.color(p.random(255), 1, 1);

                this.rocketImage = env.rocketImages[p.round(p.random(env.rocketImages.length - 1))];
            }

            explode() {

                this.exploded = true;

                if (this.sparkVectors) { // push payload 
                    for (let velVec of this.sparkVectors) {

                        let random = p.random(env.letterSparkRandomness * 2) - env.letterSparkRandomness;

                        this.sparks.push(
                            new Spark(
                                p.createVector(this.pos.x, this.pos.y),
                                p.createVector((this.vel.x / 4) + velVec[0] * env.sparkVel + random, velVec[1] * env.sparkVel + random),
                                this.color
                            )
                        );
                    }
                } else { // push random sparks
                    let sparkAmount = env.minSparkAmount + p.random(env.maxSparkAmount - env.minSparkAmount);

                    for (let i = 0; i < sparkAmount; i++) {
                        this.sparks.push(
                            new Spark(
                                p.createVector(this.pos.x, this.pos.y),
                                p.createVector((this.vel.x / 6) + p.random(env.sparkVel * 3) - (env.sparkVel * 1.5), +p.random(env.sparkVel * 2) - env.sparkVel),
                                this.color
                            )
                        );
                    }
                }
            }

            update() {
                this.vel.add(GRAVITY);
                this.pos.add(this.vel);

                // explode when turning arround
                if (this.exploded == false && this.vel.y >= env.pointOfExplosion)
                    this.explode();
            }

            draw() {

                if (!this.exploded) { // draw rockets

                    p.image(this.rocketImage, this.pos.x, this.pos.y);

                } else if (this.ftl > 0) { // draw sparks

                    this.ftl = this.ftl - 1; // shorten ttl

                    if (this.ftl == 0) {

                        this.destroy();

                    } else {

                        if(p.frameRate() > 30 || p.random(1) > env.flickerIntensity){ // below 30 fps every rocket becomes a flickerer

                            // decrease opacity; increase brightness
                            this.color.setAlpha(this.ftl / env.ftl);
                            this.color.setRed(p.red(this.color) + env.sparkColorFadeout * ((255 - p.red(this.color)) * (1 - (this.ftl / env.ftl))));
                            this.color.setBlue(p.blue(this.color) + env.sparkColorFadeout * ((255 - p.blue(this.color)) * (1 - (this.ftl / env.ftl))));
                            this.color.setGreen(p.green(this.color) + env.sparkColorFadeout * ((255 - p.green(this.color)) * (1 - (this.ftl / env.ftl))));

                            p.stroke(this.color);

                            for (let spark of this.sparks) {
                                spark.update();

                                if(!this.flickerer || p.random(1) > env.flickerIntensity)
                                    spark.draw();
                            }   
                        }
                    }
                }
            }

            destroy() {
                env.rockets.splice(this, 1);
            }
        }

        // load images from rocket-images folder
        p.preload = function () {
            for (let i = 0; i < rocketImages.length; i++) {
                env.rocketImages[i] = p.loadImage(env.imgLoc + '/' + rocketImages[i]);
            }
        }

        // run once
        p.setup = function () {

            // create new canvas - fill wrapper
            canvas = p.createCanvas(
                document.getElementById(env.wrapperID).clientWidth,
                document.getElementById(env.wrapperID).clientHeight
            );

            // connect to canvas
            env.setCanvas(canvas);

            p.colorMode(p.HSB, 255, 1, 1, 1);
        }

        // run continous (frameRate)
        p.draw = function () {

            if (env.mode != 'manual') {

                // add a new rocket every once in a while
                let add = (p.random(1) < env.frequency && env.rockets.length < env.maxRockets) ? true : false;

                if (add == true) {
                    let payload = null;

                    // get payload for shapes
                    if (env.mode.includes('mixed') && p.random(1) < env.shapeChance) {
                        if (env.mode.includes('mixed ')) {
                            let shape = env.mode.replaceAll('mixed ', '');
                            payload = shapes[shape][p.round(p.random(shapes[shape].length - 1))];
                        }
                    } else if (Object.keys(shapes).includes(env.mode)) {
                        payload = shapes[env.mode][p.round(p.random(shapes[env.mode].length - 1))];
                    } else if (env.mode == 'random') {
                        let shapeType = Object.keys(shapes)[p.round(p.random(Object.keys(shapes).length - 1))];
                        payload = shapes[shapeType][p.round(p.random(shapes[shapeType].length - 1))];
                    }
                    env.launchRandomRocket(payload);
                }
            }

            //if(p.random(1) > 0.)
            p.clear();

            // set FrameRate
            p.frameRate(env.frameRate);

            // draw background
            p.background(env.backgroundColor);

            for (let rocket of env.rockets) {
                rocket.update();
                rocket.draw();
            }
        }
    }, wrapperID); // attach to DOM

    // handle resizeEvents -> resize canvas to fill wrapper
    document.body.onresize = function () {
        env.resizeCanvas(document.getElementById(env.wrapperID).clientWidth, document.getElementById(env.wrapperID).clientHeight);
    };

    return env;

}

